import React from "react";

function ExpertCard(props){
    return (
        <div>
            <img src={props.avatar} alt="expert" />
            <p>{props.name}</p>
            <p>{props.description}</p>
            <p>{props.rating}</p>

        </div>
    )
}

export default ExpertCard
